import Navbar from "../Navbar/Navbar.jsx"
import styles from "./About.module.css"

export default function About(){
    return(
        <>
            <Navbar/>
            <div className={styles.about}>
                <h1>About</h1>
                <img src="https://img2.freepng.es/20180404/kow/kisspng-portal-morty-smith-rick-sanchez-t-shirt-hoodie-portal-5ac4b0cbbb8624.4893631615228397557681.jpg" alt="img"/>
            </div>
        </>
    )
}
